package minecraft

import (
	"github.com/google/uuid"
	"github.com/sandertv/gophertunnel/minecraft"
	"github.com/sandertv/gophertunnel/minecraft/protocol"
	"github.com/sandertv/gophertunnel/minecraft/protocol/login"
	"github.com/sandertv/gophertunnel/minecraft/protocol/packet"
	"math/rand"
	"time"
)

var proxies []proxyInfo

func init() {
	proxies, _ = loadProxies("proxies.txt")
}

func Connect(target string) (*minecraft.Conn, error) {
	if len(proxies) > 0 {
		// Override the default RakNet network with our anonymous RakNet network.
		minecraft.RegisterNetwork("raknet", NewAnonymousRakNet(proxies))
	}

	serverConn, err := minecraft.Dialer{
		TokenSource:                src,
		DisconnectOnInvalidPackets: false,
		DisconnectOnUnknownPackets: false,

		ClientData: login.ClientData{
			CurrentInputMode:                 packet.InputModeTouch,
			DefaultInputMode:                 packet.InputModeTouch,
			ClientRandomID:                   time.Now().UnixMilli(),
			SkinResourcePatch:                "ewogICAiZ2VvbWV0cnkiIDogewogICAgICAiZGVmYXVsdCIgOiAiZ2VvbWV0cnkuaHVtYW5vaWQuY3VzdG9tIgogICB9Cn0K",
			DeviceOS:                         protocol.DeviceAndroid,
			SelfSignedID:                     uuid.New().String(),
			DeviceID:                         uuid.New().String(),
			LanguageCode:                     "en_US",
			DeviceModel:                      "NITRO N50-620 ACER",
			SkinColour:                       "#0",
			ArmSize:                          "wide",
			SkinID:                           "Custom" + uuid.New().String(),
			SkinImageHeight:                  64,
			SkinImageWidth:                   64,
			CompatibleWithClientSideChunkGen: true,
			SkinData:                         "",
			SkinGeometry:                     "",
		},
	}.DialTimeout("raknet", target, time.Minute*3)
	if err != nil {
		return nil, err
	}

	return serverConn, serverConn.DoSpawn()
}

var chars = []rune("ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789")

func generateString() string {
	b := make([]rune, rand.Intn(5-4)+5)
	for i := range b {
		b[i] = chars[rand.Intn(len(chars))]
	}
	return string(b)
}
